For the first time in movie history, audiences will truly see and feel what it was like when dinosaurs ruled the Earth. &quot;Walking with Dinosaurs&quot; is the ultimate immersive experience, utilizing state of the art 3D to put audiences in the middle of a thrilling and epic prehistoric world, where an underdog dino triumphs to become a hero for the ages. 


